import React, {Component} from "react";
import "./App.css";
import PageTreeData from "./page-tree/data.js";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div>Hello</div>
      </div>
    );
  }


  componentDidMount() {
    const getDataNodes = () => {
      const nestedList = [];
      PageTreeData().then(result => {
        const item = object => {
          return (<div id={object.id}>{object.name}</div>);
        }

        const addAllItems = (pages) => {
          pages.forEach(page => {
            nestedList.push(item(page));
            if (page.hasOwnProperty("children")) {
              addAllItems(page.children);
            }
          });
        }

        addAllItems(result);
        return nestedList;
      });
    }
  }
}


export default App;
